	self.MouseClick = function(sender,args)
		--Turbine.Shell.WriteLine("test");
		if (args.X < 5)then
			self.cpBox:SetLeft(args.X);
		elseif (args.X > 96)then
			self.cpBox:SetLeft(94);
		else
			self.cpBox:SetLeft(args.X-2);
		end
		if (args.Y < 5)then
			self.cpBox:SetTop(args.Y);
		elseif (args.Y > 21) then
			self.cpBox:SetTop(19);
		else
			self.cpBox:SetTop(args.Y-2);
		end
		self.cpBox:SetVisible(true);
		targs={};
		inX=args.X+1;
		inY=args.Y+1;
		targs["Color"]=self.colorData[inY][inX];
		self.Color = targs.Color;
		self.ColorChanged(self,targs);
		self.doActive();
	end
	
	self.ColorChanged = function(sender,args)
	
	end
	self.GetColor = function()
	return self.Color;
	end
	
	self.reset = function()
	self.cpBox:SetVisible(false);
	end
	
	self.SetEnabled=function(bool)
		if(bool==true)then
		self.reset();
		self:SetBackground("./Esy/ChatNotif/res/ColorPicker.tga");
		self:SetMouseVisible(true);
		else
		self.reset();
		self:SetBackground("./Esy/ChatNotif/res/ColorPicker_disabled.tga");
		self:SetMouseVisible(false);
		end
	end
	
	self.doActive=function()
	
	end
